        <>
        <div>
        <h1>Hello</h1>
        <input type="text" 
               placeholder="Enter Your Name" 
               Value="" 
               onChange={inputEvent}
               />
        <button>Click Me 👍</button>
        </div>
        </>
    );
};

export  default App;
